import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return ( < div className = "App" > < header className = "App-header" > < img src = {
            logo
        }
        className = "App-logo"
        alt = "logo" / > < a className = "App-link"
        href = "https://reactjs.org"
        target = "_blank"
        rel = "noopener noreferrer" > Learn React < /a> < /header> < script color = "255, 255, 255"
        count = "100"
        opacity = "0.7"
        src = "https://cdn.bootcss.com/canvas-nest.js/1.0.1/canvas-nest.min.js"
        type = "text/javascript"
        zindex = "-2" > < /script> < /div>);
}
export default App;
